import { Button, Form, Row, Col, Container, InputGroup } from 'react-bootstrap';
import * as formik from 'formik';
import * as yup from 'yup';

function Register() {
    const { Formik } = formik;
    const schema = yup.object().shape({
        ime: yup.string().required(),
        prezime: yup.string().required(),
        oib: yup.string().required(),
        email: yup.string().required(),
        lozinka: yup.string().required(),
    });


    return (
        <Formik
            validationSchema={schema}
            onSubmit={console.log}
            initialValues={{
                ime: '',
                prezime: '',
                oib: '',
                email: '',
                lozinka: '',
            }}
        >

            {({ handleSubmit, handleChange, values, touched, errors }) => (

                <Container className="justify-content-md-center">
                    <Form noValidate onSubmit={handleSubmit}>
                        <Row className="mb-3">
                            <Form.Group as={Col} md="4" controlId="validationFormik01">
                                <Form.Label>Ime</Form.Label>
                                <Form.Control
                                    type="text"
                                    name="ime"
                                    value={values.ime}
                                    onChange={handleChange}
                                    isValid={touched.ime && !errors.ime}
                                />
                                <Form.Control.Feedback>Ispravno uneseno!</Form.Control.Feedback>
                            </Form.Group>
                            <Form.Group as={Col} md="4" controlId="validationFormik02">
                                <Form.Label>Prezime</Form.Label>
                                <Form.Control
                                    type="text"
                                    name="prezime"
                                    value={values.prezime}
                                    onChange={handleChange}
                                    isValid={touched.prezime && !errors.prezime}
                                />

                                <Form.Control.Feedback>Ispravno uneseno!</Form.Control.Feedback>
                            </Form.Group>
                        </Row>
                        <Row className="mb-3">
                            <Form.Group as={Col} md="6" controlId="validationFormik03">
                                <Form.Label>OIB</Form.Label>
                                <Form.Control
                                    type="text"
                                    placeholder="OIB"
                                    name="oib"
                                    value={values.oib}
                                    onChange={handleChange}
                                    isInvalid={!!errors.oib}
                                />

                                <Form.Control.Feedback type="invalid">
                                    {errors.oib}
                                </Form.Control.Feedback>
                            </Form.Group>
                            <Form.Group as={Col} md="3" controlId="validationFormik04">
                                <Form.Label>Email</Form.Label>
                                <Form.Control
                                    type="text"
                                    placeholder="Email"
                                    name="email"
                                    value={values.email}
                                    onChange={handleChange}
                                    isInvalid={!!errors.email}
                                />
                                <Form.Control.Feedback type="invalid">
                                    {errors.email}
                                </Form.Control.Feedback>
                            </Form.Group>
                            <Form.Group as={Col} md="3" controlId="validationFormik05">
                                <Form.Label>Lozinka</Form.Label>
                                <Form.Control
                                    type="password"
                                    placeholder="Lozinka"
                                    name="lozinka"
                                    value={values.lozinka}
                                    onChange={handleChange}
                                    isInvalid={!!errors.lozinka}
                                />

                                <Form.Control.Feedback type="invalid">
                                    {errors.lozinka}
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Row>

                        <Button type="submit">Registritaj se</Button>
                    </Form>

                </Container>
            )}
        </Formik>
    );
}

export default Register;
